INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (5, 1, 126001, "クリア", 40011, 0, 325, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 24001, 2);
